  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '如：上限，上上限，高报，高高报等',
  `level` int(10) unsigned NOT NULL DEFAULT '1',
  `rule` varchar(50) NOT NULL DEFAULT '' COMMENT '规则',
  `value` varchar(50) NOT NULL DEFAULT '',
  `state` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '0-未同步, 1-已同步kmx',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='模板-监控指标阀值';

